import ExpenseItem from './components/ExpenseItem'
import Expenses from './components/Expenses'


const expenses = [
  {
    id: 'e1',
    title:'toilet paper',
    amount: 80,
    date: new Date(2021,3,4)
  },
  {
    id: 'e2',
    title:'condons',
    amount: 803,
    date: new Date(2021,3,4)
  },
  {
    id: 'e3',
    title:'frits',
    amount: 820,
    date: new Date(2021,3,4)
  }
]


function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses expenses={expenses}/>
      <ExpenseItem expenseDate={expenses[0].date} expenseAmount={expenses[0].amount} expenseTitle={expenses[0].title} />
      <ExpenseItem expenseDate={expenses[1].date} expenseAmount={expenses[1].amount} expenseTitle={expenses[1].title} />
      <ExpenseItem expenseDate={expenses[2].date} expenseAmount={expenses[2].amount} expenseTitle={expenses[2].title} />
    </div>
  );
}

export default App;
